
from typing import List
class Solution:
    def exist(self, board: List[List[str]], word: str) -> bool:
        m = len(board)
        n = len(board[0])
        self.res = False
        visited = set()
        for i in range(m):
            for j in range(n):
                if board[i][j] == word[0]:
                    visited.add((i, j))
                    self.dfs(board, word, 1, i, j, visited)
                    visited.remove((i, j))
        return self.res


    def dfs(self, board: List[List[str]], word: str, pos: int, x:int, y:int, visited: set):
        
        print(pos)
        if pos == len(word):
            self.res = True
            return

        directions = [-1, 0, 1, 0, -1]

        for i in range(4):
            dx = x + directions[i]
            dy = y + directions[i + 1]

            if 0 <= dx < len(board) and 0 <= dy <= len(board[dx]) and board[dx][dy] == word[pos] and (dx, dy) not in visited:
                visited.add((dx, dy))
                self.dfs(board, word, pos + 1, dx, dy, visited)
                visited.remove((dx, dy))


